import { Button, Card } from "antd";

export default function Home() {
  const [channel, setChannel] = useState({});

  const channelLayout = (
    <div className="channel-container">
      <div></div>
    </div>
  );

  return;
  <div>
    <h1>{channel}</h1>
    {channelLayout}
  </div>;
}
